import React, { useState } from 'react'

export const Surya = () => {
    const[name,setName] = useState('surya')
    function vikram (){
        setName(name = 'vikram')
    }
    function raghu (){
        setName(name = 'raghu')
    }
  return (

    <div>
        <button>surya</button>
        <button onClick={vikram}>vikram</button>
        <button onClick={raghu}>raghu</button>
    
    </div>
  )
}
